"meal_plan\":\"B+L+D\"},{\"attraction\":\"Munnar - Periyar\",\"daywise_program\":\"in the morning, drive towards Periyar. Upon arrival in Periyar, check in at the hotel to relax. Spend the rest of the day at leisure. Stay overnight in Periyar.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Periyar\",\"daywise_program\":\"In the morning, enjoy wildlife exploration via boat trip. This boat ride is of around one and a half hour where you can spot birds, deer, elephants and boars on the banks of the Lake. Other than this, you can also opt for a guided trek through the Periyar National Park. Afternoon can visit Spice Plantation. Stay overnight in the hotel.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Periyar - Kumarakom\",\"daywise_program\":\"Post breakfast in the morning, head straight to Kumarakom. Upon arrival in Kumarakom, check in at the hotel to relax. In the afternoon, enjoy boating on the Kumarakom Lake. Overnight stay in Kumarakom.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\" Kumarakom - Alleppey\",\"daywise_program\":\"On the 10th day, start with a visit to the Kumarakom Bird Sanctuary. In the afternoon, head straight to Kottayam to board the houseboat. Enjoy a relaxing backwater cruise through the palm-fringed backwaters of Alleppey. Stay overnight on board the houseboat.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Mumbai Departure\",\"daywise_program\":\"The morning is free to relax on the beach. Later, drive to the Trivandrum airport to board flight back to Mumbai. Upon arrival in Mumbai, you will be transferred to the international airport to board flight back home.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"B+D\"}]","hotel_array":"[{\"city_name\":\"Munnar\",\"hotel_name\":\"Elixir Hills\",\"hotel_type\":\"4 Star\",\"total_night\":\"7\"}]","transport_array":"[{\"vehicle_name\":\"ETIOS\",\"pickup_type\":\"city\",\"pickup\":\"Munnar\",\"drop_