ater<\/li><\/ul><br>","sightseeing_array":"[{\"attraction\":\"Arrival in Dubai \\u2013 Dhow Marine Cruise\",\"daywise_program\":\"As soon as you arrive at the Dubai International Airport, our tour representative will greet and escort you to the Dubai Hotel. You can choose to spend some time relaxing and enjoying the scenic view from your hotel. As the evening comes, you will be going out for the Dhow Dinner cruise which takes you for a ravishing tour along the Dubai Creek. The glimmer of the city will win your heart and make you want to stay more. Enjoy fine dining the Dubai way on the cruise.\",\"overnight_stay\":\"dubai\",\"meal_plan\":\"B+L\"},{\"attraction\":\"Dubai \\u2013 City Tour\",\"daywise_program\":\"This day you will be going out for a half day city tour so make sure you have enough breakfast to keep you energetic. An English speaking guide will accompany you and make traveling to the historic sites and the modern life of Dubai easy. The first stop for the day is Burj Al Arab where you can click photos, followed by a visit to Jumeirah. It is known as a palace and residential area of Dubai, which also houses the pristine Jumeirah Mosque.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Dubai \\u2013 Desert Safari\",\"daywise_program\":\"Start the day with leisurely breakfast and explore the hotel facilities. As the day progresses, you will be taken for a desert safari where you can spot the dunes and make a stop for clicking photos. You will also visit the camel farm and can choose to explore more on the safari. One thing that you will surely love is the sunset view, after which you will be taken to the campsite. Along with enjoying sand boarding, you can try camel riding and also get henna designs.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Dubai-Burj Khalifa\",\"daywise_program\":\"Begin the day with a filling breakfast as after that you will be visiting the prime attraction of Dubai, Burj Khalifa. It is known as the tallest tower in the world. From the observation deck which sits on the 124th floor, you can get astounding views of Dubai.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-5 Dubai Aquarium-Underwater Zoo-Burj Khalifa\",\"daywise_program\":\"Today morning after breakfast proceed for Dubai mall and be part of the mesmerizing Dubai Aquarium & Underwater Zoo, it offers fascinating insight into the worlds most mysterious marine life. Later in the evening proceed to visit the Burj Khalifa Described as both a \\\\'Vertical City\\\\' and \\\\'A Living Wonder\\\\', Burj Khalifa, developed by Dubai-based Emaar Properties PJSC, is the world\\\\'s tallest building. Later enjoy the musical fountain show.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\" Depart Dubai\",\"daywise_program\":\"This day marks the end of your fun-filled vacation in Dubai. Relish your breakfast and spend the day at leisure. In the afternoon you can go shopping. Later in the evening, you will be escorted to the airport for your onward journey.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"Dinner\"}]","hotel_array":"[{\"city_name\":\"Dubai United Arab Emirates\",\"hotel_name\":\"Hilton Dubai Al\",\"hotel_type\":\"3 Star\",\"total_night\":\"5\"}]","transport_array":"[{\"vehicle_name\":\"INNOVA\",\"pickup_type\":\"city\",\"pickup\":\"Dubai United Arab Emirates\",\"drop_type\":\"airport\",\"drop\":\"Dubai International Airport (DXB)\"}]","package_tariff_array":"[]","package_offer_array":"[]"},{"package_id":"5","dest_name":"Dubai","dest_id":"39","package_name":"Magestic dubai with abu dhabi","package_code":"654","total_days":"7","total_nights":"6","p_currency_id":"1","tour_type":"International","note":"","adult_cost":0,"infant_cost":0,"child_with":0,"child_without":0,"extra_bed":0,"image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-landing.jpg","p_currency_name":"AED","inclusions":"<ul class=\\\"no-marg\\\" style=\