d the Dubai Marina Mall. You will also get a chance to admire the unique architecture that surrounds the area in form of residential buildings, recreational spaces, and office buildings in evening or in night-time cruise you can see New Dubai glittering under the dark sky. Enjoy Marina Dhow Cruise with delicious dinner.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"Dinner\"},{\"attraction\":\"Day-2 Half Day Dubai City Tour & Desert Safari with BBQ Dinner\",\"daywise_program\":\"Today after breakfast you will get an opportunity to get acquainted with Dubai city Tour Visit to Dubais famous landmarks such as the sail-shaped Burj Al-Arab hotel and beautiful Jumeirah Mosque, and learn interesting details about each attraction from a local guide. Take in views of the citys most picturesque palaces and residential areas, and venture into Bastakiya, Dubais inspiring old quarter. Cross Dubai Creek by abra (water taxi) and visit the Spice Soul. vening Enjoy Desert Safari with BBQ Dinner & Belly Dancing.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-3 Dubai Frame & Dhow Cruise Dinner\",\"daywise_program\":\"Visit Dubai Frame - known as the biggest picture frame on the planet. Later in the evening we will embark on the Dhow Dinner Cruise- enjoy amazing view of the Dubai skyline.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-4 Miracle Garden, Desert Safari with Belly dance show\",\"daywise_program\":\"Today we visit Miracle Garden (if operational) -This is the largest natural flower garden in the world. After that we enjoy thrilling Desert Safari by four wheeled drive Land Cruiser through Sand dunes followed by amazing Belly Dance show along with Dinner.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-5 Dubai Aquarium-Underwater Zoo-Burj Khalifa\",\"daywise_program\":\"Today morning after breakfast proceed for Dubai mall and be part of the mesmerizing Dubai Aquarium & Underwater Zoo, it offers fascinating insight into the worlds most mysterious marine life. Later in the evening proceed to visit the Burj Khalifa Described as both a \\\\'Vertical City\\\\' and \\\\'A Living Wonder\\\\', Burj Khalifa, developed by Dubai-based Emaar Properties PJSC, is the world\\\\'s tallest building. Later enjoy the musical fountain show.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-6 Abu Dhabi City tour-Ferrari World\",\"daywise_program\":\"Today after breakfast proceed for Abu Dhabi city tour with Ferrari world , the leading seasonal cultural extravaganza in the region and one of the best things to do in Dubai each time you visit.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-10 Dubai-Departure\",\"daywise_program\":\"After Breakfast at hotel Check out from hotel and get transferred to the airport to catch your flight back to your destination.Tour End\",\"overnight_stay\":\"Tour Ends\",\"meal_plan\":\"B+D\"}]","hotel_array":"[{\"city_name\":\"Abu Dhabi United Arab Emirates\",\"hotel_name\":\"The Leela Hotel\",\"hotel_type\":\"5 Star\",\"total_night\":\"6\"}]","transport_array":"[{\"vehicle_name\":\"AMAZE\",\"pickup_type\":\"city\",\"pickup\":\"Abu Dhabi United Arab Emirates\",\"drop_type\":\"city\",\"drop\":\"Abu Dhabi United Arab Emirates\"}]","package_tariff_array":"[]","package_offer_array":"[]"},{"package_id":"6","dest_name":"Dubai","dest_id":"39","package_name":"Mauritius Dubai Package","package_code":"056","total_days":"8","total_nights":"7","p_currency_id":"1","tour_type":"International","note":"","adult_cost":0,"infant_cost":0,"child_with":0,"child_without":0,"extra_bed":0,"image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-landing.jpg","p_currency_name":"AED","inclusions":"<ul class=\\\"no-marg\\\" style=\\\"box-sizing: border-box; margin-bottom: 25px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; margin-top: 0px !important; margin-right: 0p