buffet breakfast in the morning, depart for Port Louis. Port Louis, besides being the capital of Mauritius, is also the biggest harbor of Mauritius (as a commercial harbor, its connected to Africa, Asia, Europe and other continents). After this, you will also visit the Natural History Museum which houses several extinct species of birds like the Dodo.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Grand Bassin\",\"daywise_program\":\"Enjoy your buffet breakfast and then prepare yourself for a sightseeing tour of Chamarel, a beautiful village and Grand Bassin, which is also called Ganga Talao. In Chamarel, pay a visit to the \\u201cSeven Colored Earth\\u201d, so-called because it consists of sand dunes in seven different colors which are known to never erode.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Mauritius-Dubai\",\"daywise_program\":\"After enjoying your buffet breakfast, you can explore the nearby areas. In the afternoon, complete the check-out formalities at the hotel and handover your luggage at the bell desk. During your free time, you can go out for shopping. Shop for some beautiful handicraft products like model boats or artificial flowers. You can also decide to buy high-quality textiles, designer jewelry and other such items.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Dubai city tour\",\"daywise_program\":\"After enjoying your breakfast, get ready for a city tour of Dubai. Firstly, you will visit the Jumeirah Mosque (the most photographed mosque in Dubai built in the styles of modern Islamic architecture), the World Trade Center (a business complex that has exhibition halls and residential apartments) and Dubai Museum (which houses ancient artifacts\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Dhow Cruise\",\"daywise_program\":\"After enjoying your breakfast, explore the various attractions of Dubai and enjoy shopping. When it comes to shopping, Dubai is the ultimate destination. Apart from gold, the other items which you can purchase are shisha pies and shawls. During the evening, enjoy the City of Lights in the Dhow Cruise and admire the magnificence of colorful and very well-lit building in Dubai along the beach. Enjoy your dinner in the cruise.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Dubai-Leisure\",\"daywise_program\":\"Today morning after breakfast spend the day as leisure to explore the city on your own and for shopping.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Departure\",\"daywise_program\":\"Post-breakfast, you are free to explore the nearby surroundings. You could simply choose to relax in your hotel if you want. After completing the check-out formalities, get transferred to the airport for your flight back home.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"B+L+D\"}]","hotel_array":"[{\"city_name\":\"Dubai United Arab Emirates\",\"hotel_name\":\"Towers Rotana\",\"hotel_type\":\"4 Star\",\"total_night\":\"7\"}]","transport_array":"[{\"vehicle_name\":\"DZIRE\",\"pickup_type\":\"city\",\"pickup\":\"Dubai United Arab Emirates\",\"drop_type\":\"city\",\"drop\":\"Dubai United Arab Emirates\"}]","package_tariff_array":"[]","package_offer_array":"[]"},{"package_id":"7","dest_name":"Andaman And Nicobar Islands","dest_id":"1","package_name":"Alluring Andaman Honeymoon Package","package_code":"62","total_days":"6","total_nights":"5","p_currency_id":"68","tour_type":"Domestic","note":"","adult_cost":0,"infant_cost":0,"child_with":0,"child_without":0,"extra_bed":0,"image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-landing.jpg","p_currency_name":"INR","inclusions":"<ul class=\\\"no-marg\\\" style=\\\"box-sizing: border-box; margin-bottom: 25px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; margin-top: 0px !important; margin-right: 0px !important; margin-left: 0px !important;\\\"><li cla