by ferry. On arrival, complete check-in formalities at the hotel and unwind.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Havelock: Enjoy Water Activities at Elephant Beach\",\"daywise_program\":\"Refuel yourself with a delectable breakfast and set off to the Elephant Beach. Now, hop into the boat at 7:30 AM that will take you to the beach. Delight in an exciting snorkeling session together here. Splashing in these serene shallow waters and exploring colorful coral colonies will surely add to your honeymoon memories. You will also come across teeming aquatic life in these waters.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Havelock: Delight in a Leisure Day\",\"daywise_program\":\"Arise to a toothsome breakfast and plan how you would like to enjoy your leisure day today. You can explore the island on your own. You can go scuba diving or sea walking. Additionally, you can also hire a motorbike to explore the island while riding through the lovely expanses. Additionally, you take a short ride in a seaplane to Port Blair. Your day won\\u2019t be complete without buying souvenirs from the local bazaars.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Port Blair: A Romantic Trip to Kalapatthar Beach\",\"daywise_program\":\"The penultimate day of your Andaman honeymoon package treats you to relaxed times. Laze around till noontime. Post lunch, check-out from the hotel. Now, you will delight in a trip to Kalapathar Beach for a visual treat. After spending some beautiful moments there, proceed to Port Blair in the evening by ferry.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\" Port Blair: The Trip Culminates\",\"daywise_program\":\"Wake up refreshed and have breakfast. Check-out from the hotel and get transferred to Veer Savarkar International airport for your journey back home.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"B+L+D\"}]","hotel_array":"[{\"city_name\