er bottle. (except Infant).<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Porter charges except itinerary.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Service Charges.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">All meals included (breakfast, lunch, dinner)<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Daily one mineral water<\/li><\/ul><br>","exclusions":"<ul class=\\\"no-marg\\\" style=\\\"box-sizing: border-box; margin-bottom: 25px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; margin-top: 0px !important; margin-right: 0px !important; margin-left: 0px !important;\\\"><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Accommodation on twin\/Double sharing basis in Deluxe hotels.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Return Air fare<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Extra bed for the extra Adult, Child (above 12 yrs) Child without bed (5-11 Yrs) i.e. Aa Per tour cost paid.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Internal transfers &amp; sightseeing by AC vehicle some sightseeings by Non AC small vehicleas tour iternary.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Food Plan As per tour Iternary.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Tour Escort.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Per day per person 2 ltrs drinking water bottle. (except Infant).<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Porter charges except itinerary.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Service Charges.<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">All meals included (breakfast, lunch, dinner)<\/li><li class=\\\"mg_tp_10\\\" style=\\\"box-sizing: border-box; margin-top: 10px;\\\">Daily one mineral water<\/li><\/ul><br>","sightseeing_array":"[{\"attraction\":\"Arrive Port Blair-Cellular Jail-Light & Sound Show\",\"daywise_program\":\"On arrive at Port Blair airport, our representative will receive and escorted to the hotel. After check-in at the hotel and little relax, we proceed to covers Cellular Jail (National Memorial), and after Light & Sound Show at Cellular Jail: At evening, we move for the Light and Sound Show at Cellular Jail where the saga of the freedom struggle brought alive.\",\"overnight_stay\":\"Port blair\",\"meal_plan\":\"\"},{\"attraction\":\"Havelock Island Sightseeing\",\"daywise_program\":\"After breakfast, day free at Havelock Island for own leisure activities.\",\"overnight_stay\":\"Havelock Island\",\"meal_plan\":\"\"},{\"attraction\":\"Port Blair-Havelock Island-Radhanagar Beach\",\"daywise_program\":\"Today, we start our journey towards Havelock island via ferry from Port Blair Harbor. On arrival at Havelock Island, our representative will receive and escort you to check-in to the resort. Later we proceed to Radhanagar Beach (Beach No. 7), the Times Magazine rated the finest beach among the best beaches in Asia. It is an ideal place for swimming, sea bathing and basking on the sun kissed beach.\",\"overnight_stay\":\"Havelock Island\",\"meal_plan\":\"B+D\"},{\"attraction\":\"Port Blair \\u2013 Ross Island \\u2013 North Bay Island\",\"daywise_program\":\"The day post breakfast is scheduled for a full-day cruising towards the popular islands of Andaman & Nicobar including Ross Island, Viper Island and North Bay (Coral Island). First of all, explore Ross Island \\u2013 a historical island that is known for its enchanting scenery, Port Blair\\\\'s capital during the British era. Our next destination is North Bay Island - also known as Coral Island, it boasts of a rich marine life that can be explored through a glass-bottom boat or scuba diving and snorkeling\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Port Blair \\u2013 Havelock Island\",\"daywise_program\":\"On day 9, hop- into a ferry from Port Blair to Havelock Island, one of the most popular attractions of Andaman and Nicobar Islands, famed for its relaxed lifestyle, beaches and scuba diving opportunities. As you reach Havelock Island, an IHPL representative meets you for an assisted transfer to the resort.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Havelock Islands-Port Blair\",\"daywise_program\":\"After breakfast, visit the very well-known Radhanagar Beach, famed as one of the top 10 beaches in Asia. When on the beach, partake in sun bathing, swimming and other fun activities. Also known as beach #7, this beach is famed for its serene and mesmerizing beauty. The sunset views here are memorable. Back to Port Blair via ferry, late afternoon. Check-into the hotel for an overnight stay.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Port Blair \\u2013 Mount Harriet \\u2013Port Blair\",\"daywise_program\":\"Post breakfast on the 11th day, the tour takes you to Mount Harriet, famed as the third highest peak of Andaman and Nicobar. The summer headquarters of British Chief Commissioner, the place all around offers some of the most panoramic views of the surrounding water and the outer area of the island. If you wish, you can also visit the National Park, nearby, home to exotic wildlife of the region.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-8 Turtle nesting ground. Later diglipur to Rangat\",\"daywise_program\":\"Today, we begin our journey to a Turtle nesting ground, Ramnagar Beach. This beach is consistently visited by Olive Ridleys turtles to hatch eggs. The support staff in this destination helps these turtles to protect the laid eggs and to help the young turtles take their first swim in the open waters. Get a chance to experience this during your trip to Ramnagar beach. Later return back from Diglipur to Baratang Island.\",\"overnight_stay\":\"Rangat\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-9 Neil Island-Port Blair-City Sightseeing -Shopping\",\"daywise_program\":\"After breakfast we start our journey towards Port Blair via ferry from Neil Island. Afternoon we take you for the tour of Port Blair city which covers Samundrika (Naval Marine Museum), Anthropological Museum, which displays the tools, models habitats, art and handcrafts of the aboriginal tribes of Andaman & Nicobar Islands.\",\"overnight_stay\":\"Port Blair\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-10 Port Blair-Ross Island-North Bay Island (Coral Island)\",\"daywise_program\":\"Today, after breakfast we will proceed for a full day cruising towards Ross Island, & North Bay(Coral Island)\\nRoss Island: First we starts the exhilarating journey to Ross Island the erstwhile capital of Port Blair during the British regime, it now stands an imposing relic, with the structure almost in debris. A small museum displays photographs and other antiques of the Britishers, relevant to these islands.\",\"overnight_stay\":\"Coral Island\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Day-11 Joyful trip to North Bay island\",\"daywise_program\":\"North Bay (Coral Island): From Ross Island, we proceed for a joyful trip to North Bay island (Coral Island) offering exotic coral, colorful fishes and underwater marine life. We can view these colorful corals & underwater marine life via in glass bottom boat and Snorkeling (optional).\",\"overnight_stay\":\"North Bay island\",\"meal_plan\":\"B+L+D\"},{\"attraction\":\"Departure from Port Blair \\u2013 Delhi\",\"daywise_program\":\"On the last day of Golden Triangle with Andaman, get transferred to Port Blair Airport to board a flight for Delhi. From Delhi International airport board another flight for your onward journey.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"B+L+D\"}]","hotel_array":"[{\"city_name\":\"Port Blair Andaman\",\"hotel_name\":\"Taj Exotica Resort & Spa\",\"hotel_type\":\"5 Star\",\"total_night\":\"11\"}]","transport_array":"[{\"vehicle_name\":\"DZIRE\",\"pickup_type\":\"city\",\"pickup\":\"Port Blair Andaman\",\"drop_type\":\"city\",\"drop\":\"Port Blair Andaman\"}]","package_tariff_array":"[]","package_offer_array":"[]"}],"company_profile_data":[{"company_name":"iTours Demo-1","website":"www.itwebservices.co","contact_no":"9860861278","address":"Venketesh Residency, Vignaharta Chowk, Pashan Sus Road, Pune, Maharashtra 411021","email_id":"test@itourscloud.com","currency":"68","app_version":"2022","canc_policy_url":"..\/..\/..\/uploads\/Cancellation Policy\/\/2021\/\/Aug\/\/05\/\/1628142487\/Appointment_slip.pdf","currency_code":"INR"}],"group_tour_data":[{"tour_id":"1","tour_type":"Domestic","tour_name":"Kerala amaze tour","dest_name":"Kerala","dest_id":"9","inclusions":"<div>1. Accommodation as per plan.<\/div><div><br><\/div><div>2. All inter transfer &amp; sightseeing as per Itinerary by Suitable NON AC Vehicle.<\/div><div><br><\/div><div>PLS. NOTE THAT VEHICLE WILL NOT BE ON DISPOSAL. IT WILL BE PROVIDED AS PER ITINERARY AND POINT TO POINT BASIS<\/div><div><br><\/div><div>&nbsp;3. News paper and bottled water on arrival.<\/div><div><br><\/div><div>4. All parking and permit charges.<\/div><div><br><\/div><div>5. Assistance on arrival.<\/div>","exclusions":"<div>1. Government Service Tax as applicable on the above rates<\/div><div><br><\/div><div>2. Airfare, Train Fare, Insurance Premium etc.<\/div><div><br><\/div><div>3. Entry Fee to Any Monument, Park, Museum, Monastery or any other visiting places.<\/div><div><br><\/div><div>4. Payment for service provided on personal basis<\/div><div><br><\/div><div>5. Expenses incurred due to mishap, landslide, strikes, political 