Thekkady\\\/Periyar\",\"daywise_program\":\"After breakfast leave for Periyar in the morning (4 hours) and transfer to hotel on arrival. You may opt for a pleasant boat ride along the Periyar Lake in the evening. Enjoy watching varied birds and animals like tigers, elephants, wild boar, deer, etc. at the Periyar \\\/ Thekkady National Park. You can also visit a few tribal villages around Periyar and witness fascinating activities of tribals collecting honey from dangerous hill bees. Evening transfer to hotel. Overnight at hotel.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/kerela\\\/Asia_India_Kerela_Alappuzha.jpg\"},{\"attraction\":\"Kumarakom - Alleppey\",\"daywise_program\":\"Kumarakom - Alleppey\\nEnjoy the magic of backwater by going on a Houseboat (Kettuvallam) cruise across the backwaters. Spend the next 22 hours in your floating villa. Enjoy the backwaters of Kerala by getting a glimpse of the village life at close quarters; a unique and unforgettable experience. Enjoy the sunset & stay overnight on the houseboat. Breakfast, lunch and dinner included.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/kerela\\\/Asia_India_Kerela_Bandipur_national_park.jpg\"},{\"attraction\":\"Kovalam Departure\",\"daywise_program\":\"After breakfast transfer to airport to connect flight for onward destination.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"Breakfast\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/flight-landing.jpg\"}]","train_groups_array":"[]","hotel_groups_array":"[{\"city_name\":\"Cochin Kerala, India\",\"hotel_name\":\"The Raviz\",\"hotel_type\":\"5 Star\",\"total_nights\":\"5\"}]","flight_groups_array":"[]","cruise_groups_array":"[]","adult_cost":"12000.00","child_with_cost":"0.00","child_without_cost":"0.00","infant_cost