marks on the international map. Among the many sights you will pass by, some that you should not miss are the Burj Al Arab, Hotel Atlantis the Palm, Palm Jumeirah, Dubai Marina Yatch Club Promenade, and the Dubai Marina Mall. You will also get a chance to admire the unique architecture that surrounds the area in form of residential buildings, recreational spaces, and office buildings in evening or in night-time cruise you can see New Dubai glittering under the dark sky. Enjoy Marina Dhow Cruise with delicious dinner.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/flight-take-off.jpg\"},{\"attraction\":\"Day-2 Half Day Dubai City Tour & Desert Safari with BBQ Dinner\",\"daywise_program\":\"Today after breakfast you will get an opportunity to get acquainted with Dubai city Tour Visit to Dubais famous landmarks such as the sail-shaped Burj Al-Arab hotel and beautiful Jumeirah Mosque, and learn interesting details about each attraction from a local guide. Take in views of the citys most picturesque palaces and residential areas, and venture into Bastakiya, Dubais inspiring old quarter. Cross Dubai Creek by abra (water taxi) and visit the Spice Soul. vening Enjoy Desert Safari with BBQ Dinner & Belly Dancing.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/uae\\\/Asia_UAE_ABU_DHABI_Moreeb_Dune.jpg\"},{\"attraction\":\"Day-3 Dubai Frame & Dhow Cruise Dinner\",\"daywise_program\":\"Visit Dubai Frame - known as the biggest picture frame on the planet. Later in the evening we will embark on the Dhow Dinner Cruise- enjoy amazing view of the Dubai skyline.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/uae\\\/Asia_UAE_ABU_DHABI_Saadiyat_Island_Cultural_District.jpg\"},{\"attraction\":\"Day-4 Miracle Garden, Desert Safari with Belly dance show\",\"daywise_program\":\"Today we visit Miracle Garden (if operational) -This is the largest natural flower garden in the world. After that we enjoy thrilling Desert Safari by four wheeled drive Land Cruiser through Sand dunes followed by amazing Belly Dance show along with Dinner.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/uae\\\/Asia_UAE_ABU_DHABI_National_Auto_Museum.jpg\"},{\"attraction\":\"Day-5 Dubai Aquarium-Underwater Zoo-Burj Khalifa\",\"daywise_program\":\"Today morning after breakfast proceed for Dubai mall and be part of the mesmerizing Dubai Aquarium & Underwater Zoo, it offers fascinating insight into the worlds most mysterious marine life. Later in the evening proceed to visit the Burj Khalifa Described as both a \\\\'Vertical City\\\\' and \\\\'A Living Wonder\\\\', Burj Khalifa, developed by Dubai-based Emaar Properties PJSC, is the world\\\\'s tallest building. Later enjoy the musical fountain show.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/uae\\\/Asia_UAE_ABU_DHABI_Yas_Island.jpg\"},{\"attraction\":\"Day-6 Abu Dhabi City tour-Ferrari World\",\"daywise_program\":\"Today after breakfast proceed for Abu Dhabi city tour with Ferrari world , the leading seasonal cultural extravaganza in the region and one of the best things to do in Dubai each time you visit.\",\"overnight_stay\":\"Dubai\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"\"},{\"attraction\":\"Day-10 Dubai-Departure\",\"daywise_program\":\"After Breakfast at hotel Check out from hotel and get transferred to the airport to catch your flight back to your destination.Tour End\",\"overnight_stay\":\"Tour Ends\",\"meal_plan\":\"Lunch\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/flight-landing.jpg\"}]","train_groups_array":"[]","hotel