ay-1 Arrive Port Blair-Cellular Jail-Light & Sound Show\",\"daywise_program\":\"On arrive at Port Blair airport, our representative will receive and escorted to the hotel. After check-in at the hotel and little relax, we proceed to covers Cellular Jail (National Memorial), and after Light & Sound Show at Cellular Jail: At evening, we move for the Light and Sound Show at Cellular Jail where the saga of the freedom struggle brought alive.\",\"overnight_stay\":\"Port blair\",\"meal_plan\":\"Breakfast\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/flight-landing.jpg\"},{\"attraction\":\"Day-2 Port Blair-Havelock Island-Radhanagar Beach\",\"daywise_program\":\"Today, we start our journey towards Havelock island via ferry from Port Blair Harbor. On arrival at Havelock Island, our representative will receive and escort you to check-in to the resort. Later we proceed to Radhanagar Beach (Beach No. 7), the Times Magazine rated the finest beach among the best beaches in Asia. It is an ideal place for swimming, sea bathing and basking on the sun kissed beach.\",\"overnight_stay\":\"Havelock Island\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Great_Andaman.jpg\"},{\"attraction\":\"Day-3 Havelock Island Sightseeing\",\"daywise_program\":\"After breakfast, day free at Havelock Island for own leisure activities.\",\"overnight_stay\":\"Havelock Island\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Great_Nicobar_Island.jpg\"},{\"attraction\":\"Day-4 Havelock Island - Neil Island\",\"daywise_program\":\"Today, we start our journey from Havelock island to Neil Island via ferry. On arrival at Neil Island, our representative will receive and escort you to check-in to the Hotel. Then we proceed to visit the sandy beaches at Bharatpur and Lakshmanpur which are very attractive for spending holidays. Tourists who like to spend vacations in an eco-friendly locale will find this Island ideal.\",\"overnight_stay\":\"Havelock Island\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Havelock_Island.jpg\"},{\"attraction\":\"Day-5 Travel from Havelock to Port blair. Later visit Chadiatapu sunset\",\"daywise_program\":\"Return back from the amazing experience of Havelock Island to Port Blair. On arrival in Port Blair our representative attends you and drops you to your hotel. Later we proceed to visit Andaman Islands best sunset point, Chidiatapu. Chidiatapu is an amazing destination for bird watching and sunset.\",\"overnight_stay\":\"Port blair\",\"meal_plan\":\"L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Lakshmanpur.jpg\"},{\"attraction\":\"Day-6 Travel from Port blair to Diglipur Island\",\"daywise_program\":\"Depart from Port Blair to Diglipur Island by road through the dense tropical forest and Jarawa Tribal reserve. Often you might see a member of the Jarawa Tribe while passing through the tribal reserve. On your journey you will take the route of Andaman Grand Trunk road passing through Baratang Island, Rangat & Mayabunder. Reach Diglipur, and check into the hotel for overnight stay. During this trip also experience the lifeline of the Andaman Islands, Vehicle Ferry that carries vehicles from one island to the other.\",\"overnight_stay\":\"Diglipur\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_portblai.jpg\"},{\"attraction\":\"Day-13 Depart from Port Blair Islands\",\"daywise_program\":\"Drop to Port Blair for Return journey.\",\"overnight_stay\":\"Tour Ends\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"\"}]","train_groups_array":"[]","hotel_groups_array":"[{\"city_name\":\"Port Blair Andaman\",\"hotel_name\":\"Hotel Coral\",\"hotel_type\":\"3 Star\",\"total_nights\":\"6\"}]","flight_groups_array":"[]","cruise_groups_array":"[]","adult_cost":"25000.00","child_with_cost":"0.00","child_without_cost":"0.00","infant_cost":"0.00","with_bed_cost":"3000.00","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-landing.jpg"},{"tour_id":"8","tour_type":"Domestic","tour_name":"Best of andaman Tour","dest_name":"Andaman And Nicobar Islands","dest_id":"1","inclusions":"<ul class=\"no-marg\" style=\"box-sizing: border-box; margin-bottom: 25px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; margin-top: 0px !important; margin-right: 0px !important; margin-left: 0px !important;\"><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Accommodation on twin\/Double sharing basis in Deluxe hotels.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Return Air fare<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Extra bed for the extra Adult, Child (above 12 yrs) Child without bed (5-11 Yrs) i.e. Aa Per tour cost paid.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Internal transfers &amp; sightseeing by AC vehicle some sightseeings by Non AC small vehicleas tour iternary.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Food Plan As per tour Iternary.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Tour Escort.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Per day per person 2 ltrs drinking water bottle. (except Infant).<\/li><li class=\"mg_tp_10\" style=\"box-