e=\"box-sizing: border-box; margin-top: 10px;\">Daily one mineral water<\/li><\/ul><br>","tour_groups_array":"[{\"from_date\":\"06-10-2022\",\"to_date\":\"12-10-2022\",\"capacity\":\"20\",\"days\":7}]","sightseeing_array":"[{\"attraction\":\"Arrival at Port Blair and Sound & Light Show\",\"daywise_program\":\"After arriving at Port Blair airport, transfer to your hotel with our representative. After check-in at the hotel, relax for a little bit. Port Blair is a beautiful city with an array of hotels, resorts, restaurants, and stunning streets. It is the most prominent destination and the hub of all tourist activities on the island. Later, have lunch and head to enjoy the Water Sports Complex (Wednesday closed). Indulge in water activities like speed boat ride, jet skiing, and baba boat ride in Aqua Fun Park (own cost).\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/flight-take-off.jpg\"},{\"attraction\":\"Port Blair to Havelock Island\",\"daywise_program\":\"Check out with a packed breakfast and proceed to Havelock. Take a ferry ride for 2.5 hours to reach the island, 54 kilometers from Port Blair. Havelock offers breathtaking views of palm trees, clear waters, and coral reefs. Once reached, check in at the hotel and rest.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Great_Andaman.jpg\"},{\"attraction\":\"Day Trip to Elephant Beach\",\"daywise_program\":\"After a hearty breakfast, get ready for the day and head out for an excursion to the Elephant Beach. Reach by 0700 hours to get to the boat that will leave at 0730 hours. Once you reach, indulge in snorkeling and witness plenty of marine life. The beach has white sand and fallen trees that are perfect for relaxing.\\n\\nAfter a fun-filled day at the beach, return to your hotel and unwind for the night.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Great_Nicobar_Island.jpg\"},{\"attraction\":\"Havelock to Neil Island\",\"daywise_program\":\"Have a delicious breakfast and check out from the hotel. Then, relocate to the jetty to board the ferry to Neil Island. After arrival, check in to the hotel and rest. In the evening, proceed for a sightseeing tour and visit Laxmanpur Beach and Bharatpur Beach.\\n\\nLater, return to the hotel and rest.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Havelock_Island.jpg\"},{\"attraction\":\"Neil Island to Port Blair\",\"daywise_program\":\"Have a delicious breakfast and check out. Then, transfer to the jetty to board the ferry to Port Blair (the time of the ferry varies upon availability). Once you reach, check in to your hotel and spend your rest at leisure.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_portblai.jpg\"},{\"attraction\":\"Port Blair City Tour\",\"daywise_program\":\"After a delicious breakfast at the hotel, head out for a city tour of Port Blair. First, visit Chatham Saw Mill, one of the oldest and largest mills in Asia, and the Forest Museum. Next, explore 350 aquatic species at the Fisheries Museum. Later, visit the Anthropological Museum to get an insight into the tribal culture of Andaman. Witness a huge collection of clothes, baskets, photographs, tribal boats, weapons, and more.\",\"overnight_stay\":\"hotel\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Neil_Island.jpg\"},{\"attraction\":\"Departure from Port Blair\",\"daywise_program\":\"Have breakfast at the hotel and check out. Then, get transferred to the airport. Finally, board your flight back home with lovely memories to cherish.\",\"overnight_stay\":\"NA\",\"meal_plan\":\"B+L+D\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Baratang_Island.jpg\"}]","train_groups_array":"[]","hotel_groups_array":"[{\"city_name\":\"Port Blair Andaman\",\"hotel_name\":\"Taj Exotica Resort & Spa\",\"hotel_type\":\"5 Star\",\"total_nights\":\"6\"}]","flight_groups_array":"[]","cruise_groups_array":"[]","adult_cost":"35600.00","child_with_cost":"0.00","child_without_cost":"0.00","infant_cost":"0.00","with_bed_cost":"3500.00","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-landing.jpg"},{"tour_id":"9","tour_type":"Domestic","tour_name":"Havelock wanderlust","dest_name":"Andaman And Nicobar Islands","dest_id":"1","inclusions":"<ul class=\"no-marg\" style=\"box-sizing: border-box; margin-bottom: 25px; color: rgb(51, 51, 51); font-family: Roboto, sans-serif; font-size: 14px; margin-top: 0px !important; margin-right: 0px !important; margin-left: 0px !important;\"><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Accommodation on twin\/Double sharing basis in Deluxe hotels.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Return Air fare<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Extra bed for the extra Adult, Child (above 12 yrs) Child without bed (5-11 Yrs) i.e. Aa Per tour cost paid.<\/li><li class=\"mg_tp_10\" style=\"box-sizing: border-box; margin-top: 10px;\">Internal transfers &amp; sightseeing by AC vehicle som