eggs and to help the young turtles take their first swim in the open waters. Get a chance to experience this during your trip to Ramnagar beach. Later return back from Diglipur to Baratang Island.\",\"overnight_stay\":\"Rangat\",\"meal_plan\":\"\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Indira_Point.jpg\"},{\"attraction\":\"Day-4 Joyful trip to North Bay island\",\"daywise_program\":\"North Bay (Coral Island): From Ross Island, we proceed for a joyful trip to North Bay island (Coral Island) offering exotic coral, colorful fishes and underwater marine life. We can view these colorful corals & underwater marine life via in glass bottom boat and Snorkeling (optional).\",\"overnight_stay\":\"North Bay island\",\"meal_plan\":\"\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Wandoor.jpg\"},{\"attraction\":\"Day-5 Travel from Havelock to Port blair. Later visit Chadiatapu sunset\",\"daywise_program\":\"Return back from the amazing experience of Havelock Island to Port Blair. On arrival in Port Blair our representative attends you and drops you to your hotel. Later we proceed to visit Andaman Islands best sunset point, Chidiatapu. Chidiatapu is an amazing destination for bird watching and sunset.\",\"overnight_stay\":\"Port blair\",\"meal_plan\":\"\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Andaman_and_Nicobar_Islands_Great_Andaman.jpg\"},{\"attraction\":\"Day-13 Depart from Port Blair Islands\",\"daywise_program\":\"Drop to Port Blair for Return journey.\",\"overnight_stay\":\"Tour Ends\",\"meal_plan\":\"\",\"daywise_image\":\"https:\\\/\\\/itourscloud.com\\\/destination_gallery\\\/asia\\\/india\\\/andaman_and_nicobar_islands\\\/Asia_India_Anda