, the customer may choose to cancel their booking before confirmation and a full refund will be processed.<\/p>","useful_info":"<ul class=\\\"product-overview__list\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; padding-left: 0px; list-style-type: none; margin: 0px; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><li class=\\\"product-overview__list-item\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; display: flex; margin-bottom: 10px;\\\">Passport or Emirates ID is mandatory to be carried during this activity.<\/li><li class=\\\"product-overview__list-item\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; display: flex; margin-bottom: 10px;\\\"><span class=\\\"product-overview__list-item-icon tours-icon-information\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; speak: none; font-feature-settings: normal; font-variant-numeric: normal; font-variant-east-asian: normal; line-height: 1; -webkit-font-smoothing: antialiased; margin-top: 5px; margin-right: 10px !important; font-family: tours-app !important; display: inline-block !important;\\\"><\/span>The session includes 30 minutes of briefing.<\/li><li class=\\\"product-overview__list-item\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; display: flex; margin-bottom: 10px;\\\"><span class=\\\"product-overview__list-item-icon tours-icon-information\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; speak: none; font-feature-settings: normal; font-variant-numeric: normal; font-variant-east-asian: normal; line-height: 1; -webkit-font-smoothing: antialiased; margin-top: 5px; margin-right: 10px !important; font-family: tours-app !important; display: inline-block !important;\\\"><\/span>You are required to wear athletic and comfortable clothes, sneakers\/sports shoes during this activity.<\/li><li class=\\\"product-overview__list-item\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; display: flex; margin-bottom: 10px;\\\"><span class=\\\"product-overview__list-item-icon tours-icon-information\\\" style=\\\"box-sizing: inherit; max-height: 1e+06px; speak: none; font-feature-settings: normal; font-variant-numeric: normal; font-variant-east-asian: normal; line-height: 1; -webkit-font-smoothing: antialiased; margin-top: 5px; margin-right: 10px !important; font-family: tours-app !important; display: inline-block !important;\\\"><\/span>Pregnant women are not allowed for this activity.<\/li><\/ul>","booking_policy":"<p style=\\\"box-sizing: inherit; max-height: 1e+06px; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">In case of unforeseen weather conditions or government restrictions, certain trips or activities may get canceled. In such cases, the operator will provide an alternate feasible date for the dive. However, a cash refund will only be applicable if the operator agrees on the same.<\/p><p style=\\\"box-sizing: inherit; max-height: 1e+06px; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><br style=\\\"box-sizing: inherit; max-height: 1e+06px;\\\"><\/p><p style=\\\"box-sizing: inherit; max-height: 1e+06px; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">If rescheduling requests are made 96 hours before the date of travel, no amount will be charged as rescheduling fees.<\/p><p style=\\\"box-sizing: inherit; max-height: 1e+06px; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><br style=\\\"box-sizing: inherit; max-height: 1e+06px;\\\"><\/p><p style=\\\"box-sizing: inherit; max-height: 1e+06px; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">If rescheduling requests are made between 0 to 72 hours before the date of travel, 10% of the total tour cost will be charged as rescheduling fees.<\/p>","canc_policy":"<ul style=\\\"box-sizing: inherit; max-height: 1e+06px; padding: 0px; list-style: none; color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\"><li style=\\\"box-sizing: inherit; max-height: 1e+06px; line-height: 1.67; display: flex; margin-top: 5px;\\\">If cancellation are made 1 days before the date of travel then 100.0% of total tour cost will be charged as cancellation fees<\/li><li style=\\\"box-sizing: inherit; max-height: 1e+06px; line-height: 1.67; display: flex; margin-top: 5px;\\\">If cancellation are made 0 days to 1 days before the date of travel then 100.0% of total tour cost will be charged as cancellation fees<\/li><\/ul>","images_array":"[{\"image_url\":\"..\\\/..\\\/uploads\\\/\\\/emp_photo_proof\\\/\\\/2022\\\/\\\/Sep\\\/\\\/07\\\/\\\/1662543368\\\/skydive (1).jpg\"}]","costing_array":"[{\"transfer_option\":\"Without Transfer\",\"from_date\":\"2022-09-07\",\"to_date\":\"2022-10-31\",\"adult_cost\":0,\"child_cost\":0,\"infant_cost\":0}]"},{"activity_id":"2","activity_name":"Hot Air Balloon in Dubai","city_name":"Dubai United Arab Emirates","city_id":"400","duration":"3","pickup_point":"dessert road","rep_time":"11:00 AM","description":"The Premium Hot Air Balloon Dubai also happens in the morning, giving you the opportunity to watch the sun going up the Hajjar Mountains and how it changes the look and the color of the desert. While you float along with the warm breeze in the air, you would be able to see the magical desert of Dubai and the wildlife in the surroundings. Take a look at the camels, oryx, gazelles, etc. of the desert from high above","off_days":"","note":"","currency":"AED","inclusions":"","exclusions":"","terms_condition":"<span style=\\\"color: rgb(80, 80, 80); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\\\">100.0% of total tour cost will have to be paid 0 days before the date of booking<\/span>","useful_info":"<ul class=\\