nians of origin who have completed the declaration in honour form are exempted from presenting this document.&nbsp;<\/div><div>Copy of marriage certificate or declaration of common-law union (for persons who are married or in legal cohabitation).<\/div><div>Parental authorization for children (ages 0 to 14 ) signed in front of a notary or a commissioner of oath \/ legalized by administrative authorities, if done in Cameroon.<\/div><div><br><\/div><div>Complementary information for visa application for children below 14 years:<\/div><div><br><\/div><div>Attach photocopy of the passports of the parents of the child\/children requesting a visa<\/div><div>Attach a copy of the birth certificate of the child\/children intending to travel<\/div><div>A separate visa application form must be filled and signed for each child.<\/div><div><br><\/div>"},{"entry_id":"38","country":"Canada","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Passport<\/div><div>2. Old passport<\/div><div>3. Photo<\/div><div>4. Air ticket<\/div><div>5. Travel insurance<\/div><div>6. Covering letter from applicant<\/div><div>7. Bank statement<\/div><div>8. Income tax returns<\/div><div>9. Itierary<\/div><div><br><\/div>"},{"entry_id":"39","country":"Cape Verde","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. One completed Cape Verde application<\/div><div>2. Two passport type photos<\/div><div>3. Physical passport with 6 months validity beyond trip completion and one blank visa page<\/div><div>4. Non-USA passport holders must provide a copy of green card or US Visa and I-94<\/div><div>5. One copy of flight itinerary<\/div>"},{"entry_id":"40","country":"Cayman Islands","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Proof o