vide proof of their funds.<\/div><div>6. Previous Visa: Previous visas if available<\/div><div>7. Proof of Funds: Proof you have enough money for your stay and to leave, such as<\/div><div>\u2022 personal bank statements<\/div><div>\u2022 Pay slips from employer<\/div><div>\u2022 Proof of accomodation<\/div><div>\u2022 Audited accounts,<\/div><div>\u2022 Tax records<\/div><div>\u2022 Credit card limit.<\/div><div>8. Proof of Return: Proof that you have reasons to return home such as:<\/div><div>\u2022 A letter from your employer stating you plan to return to your job<\/div><div>\u2022 Proof that you study at a school, college or university in your home country<\/div><div>\u2022 Proof that you have immediate family members in your home country(photos, marriage certificates etc)<\/div><div>\u2022 Proof that you can return home<\/div><div>\u2022 Proof that you own a house or other major assets in your home country<\/div><div>9. Travel itinerary: Travel itinerary (travel reservation to and from the country\/area in your name, not a ticket)<\/div>"},{"entry_id":"95","country":"Holy See (vatican City State)","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Hold a passport valid for at least six months beyond your date of country exit and with one blank visa page<\/div><div>2. Hold proof of onward and return flights<\/div><div>3. Hold all documents required for the next destination<\/div><div>4. Hold documents showing proof of travel purpose (e.g. business cover or support letter, conference registrations, etc.)<\/div><div>5. Hold proof of sufficient funds relative to your intended length of stay<\/div><div>6. It is recommended that you confirm with your airline that boarding will be permitted without a visa<\/div>"},{"entry_id":"96","country":"Honduras","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":