ermanent or temporary parental authority or legal guardianship.<\/div><div>2. A recent (not older than 1 month) photograph in accordance with the international standards as set out in the International Civil Aviation Organization (ICAO) document 9303 Part 1, 6th edition.<\/div><div>3. A copy of your travel document. Its validity shall extend at least three months after the intended date of departure from the territory of the Republic of Kosovo. It shall contain at least two blank pages.<\/div><div>4. documents indicating the purpose of the journey.<\/div><div>5. documents in relation to accommodation, or proof of sufficient means to cover his\/her accommodation;<\/div><div>6. documents indicating that the applicant possesses sufficient means of subsistence both for the duration of the intended stay and for the return to his country of origin or residence, or for the transit to a third country into which he is certain to be admitted, or that he is in a position to acquire such means lawfully;<\/div><div>7. Information enabling an assessment of the applicant\u2019s intention to leave the territory of the Republic of Kosovo before the expiry of the visa applied for.<\/div><div>8. Travel medical insurance valid throughout the territory of the Republic of Kosovo which covers the entire period of the person\u2019s intended stay or transit.<\/div><div>9. The visa fee payment of 40 EUR that applicants need to pay unless they are holders of diplomatic and official passports; children nder six (6) years old; or school children, students and teachers accompanying and visiting for studying or training purposes.<\/div>"},{"entry_id":"115","country":"Kuwait","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Air ticket<br>4. Pan card"},{"entry_id":"116","country":"Kyrgyzstan","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","