l, signed by the applicant. If the applicant is a minor, the<\/div><div>cover letter must be signed by the parent(s) or legal guardian.<\/div><div>2. One (1) passport photo, not older than six (6) months, in color with a light background, 35 \u2013 40 mm<\/div><div>in width.<\/div><div>3. Passport (both new and old), valid at least three (3) months after the intended date of departure from<\/div><div>the Schengen area, containing at least two blank pages, and issued within the previous 10 years.<\/div><div>4. Copy of passport(s) (all used pages including the bio data page)<\/div><div>5. Original invitation letter dated and signed by the inviter\/sponsor in Svalbard\/ Spitsbergen, stating<\/div><div>the purpose and duration of the visit, the relation with the applicant and any other information about<\/div><div>the applicants visit (not older than three (3) months).<\/div><div>6. Original Guarantee Form for Visits filled out by the inviter\/sponsor in Svalbard and stamped by<\/div><div>Norwegian authorities + 1 copy (if the applicant does not have sufficient financial means to cover the<\/div><div>cost of travel).<\/div><div>7. Copy of inviter\/sponsor passport<\/div><div>8. A valid travel medical insurance for the duration of the intended stay in the Schengen area with a<\/div><div>minimum coverage of EURO 30.000<\/div><div>9. Flight booking of roundtrip air ticket to Svalbard (Longyearbyen), and other travels within the<\/div><div>Schengen area, if applicable. Do not purchase the ticket until a visa has been granted.<\/div><div>10. Minors (under 18 years of age):<\/div><div>- student card and\/or original letter from the school, mentioning:<\/div><div>o full address, telephone number(s) of the school<\/div><div>o name and function of the person giving permission<\/div><div>o approval for leave of absence<\/div><div>- Proof of relationship or guardianship.<\/div><div>- When applicant is travelling alone, or only with one parent: letter of permission to travel signed<\/div><div>by both parents or legal guardians, and copy of the passport of the parent not travelling.<\/div><div>11. Letter granting Power of Attorney (optional for applicants who want the sponsor or other person to<\/div><div>represent them in the case).<\/div><div>12. If applicable, a written explanation as to why the applicant cannot present any or some of the<\/div><div>documents<\/div>"},{"entry_id":"206","country":"Swaziland","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Passport requirements<\/div><div>2. Proof of travel arrangements<\/div><div>3. Special instructions<\/div>"},{"entry_id":"207","country":"Sweden","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Relationship proof<br>10. Covering letter from applicants<br>11. Hotel vocuher"},{"entry_id":"208","country":"Switzerland","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Travel insurance<br>6. Bank statement<br>7. Income tax returns<br>8. Itinerary<br>9. Hotel voucher<br>10. Covering letter from applicant&nbsp;"},{"entry_id":"209","country":"Syrian Arab Republic","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Photo<br>3. Air ticket<br>4. Guarantee letter&nbsp;<br>5. Old passport"},{"entry_id":"210","country":"Taiwan","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"1. Passport<br>2. Old passport<br>3. Photo<br>4. Air ticket<br>5. Covering letter fro