t.<\/div><div>6. Previous Yemen visa - if applicable.<\/div><div>7. Original saving bank statements last 6 months updated with a healthy balance.<\/div><div>8. Enough blank pages in your passport to fit the required entry visa.<\/div><div>9. Bank Statement.&nbsp; Copies of bank statements from the past 3 months.<\/div><div>10. Confirmation of round-trip airline ticket or airline ticket to another destination.<\/div><div>11. Medical travel insurance (Schengen). with a minimum coverage of \u20ac30,000 and validity for all Schengen states.<\/div><div>12. Employment Letter. A letter from your employer\/school (on business letterhead, with contact details), stating that a leave of absence has been granted and that you will be returning to your current job. If you are self-employed, include a copy of your business license and tax return. If you are retired please submit proof of your retirement fund.<\/div><div>13. Pay Stubs. Copies of 3 most recent pay stubs.<\/div><div>14. Hotel Reservations. Copy of the Hotel Reservations.<\/div><div>15. Personal Invitation. If visiting friends or family, you must provide letter of invitation with the contact information of the host and visitor,&nbsp;<\/div><div>purpose and duration of the visit, confirmation of accommodation including the address, signature and date.&nbsp;<\/div><div>You will also need to provide proof of the host\\'s status in Wallis Futuna Islands ie.&nbsp;<\/div><div>copy of their Wallis Futuna Islands passport\\'s information page, or, if they are not a citizen of Wallis Futuna Islands,&nbsp;<\/div><div>copies of their Wallis Futuna Islands residence permit and their national passport\\'s information pages.<\/div>"},{"entry_id":"235","country":"Western Sahara","visa_type":"Tourist Visa","basic_amount":"0.00","markup_amount":"0.00","total_days":"30 Days","form_1":"","form_2":"","documents":"<div>1. Visa Application Form<\/div><div>2. Passport Photo<\/div><div>3. Passport<\/div><div>4. Passport Copy<\/div><div>5. Re