timonial-2.jpg","testm":"We went by iTours travels to Chardham Yatra on 17 June. It was overall a good experience. Our tour guide Mr. Shubham was one of the best guides we have ever had amongst the many conducted tours we have been in and outside the country. He was like a rock standing behind every traveller reassuring and assisting each one of us. The hotels and facilities were mediocre but the cooking staff, drivers, were exemplary. They served us hot food with a smiling face each day of the tour."},{"name":"Gayatri","designation":"QA analyst","image":"..\/..\/..\/uploads\/\/testimonials\/\/2022\/\/Sep\/\/07\/\/1662545246\/testimonial-4.jpg","testm":"We went by iTours travels to Chardham Yatra on 17 June. It was overall a good experience. Our tour guide Mr. Shubham was one of the best guides we have ever had amongst the many conducted tours we have been in and outside the country. He was like a rock standing behind every traveller reassuring and assisting each one of us. The hotels and facilities were mediocre but the cooking staff, drivers, were exemplary. They served us hot food with a smiling face each day of the tour. I would highly recommend Gurunath travels because of the tour guide Mr. Shubham and the staff."}]}],"gallary_array":[{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-landing.jpg","description":"Flight-landing"},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/flight-take-off.jpg","description":"Flight-take-off"},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/train-arrival.jpg","description":"Train-arrival"},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/train-depature.jpg","description":"Train-depature"},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Baratang_Island.jpg","description":"Baratang Island is an island of the Andaman Islands. It belongs to the North and Middle Andaman"},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Great_Andaman.jpg","description":"The main archipelago of the Andaman Islands of India. It comprises seven major islands."},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Great_Nicobar_Island.jpg","description":"Great Nicobar is the southernmost and largest of the Nicobar Islands of India, north of Sumatra."},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Havelock_Island.jpg","description":"It is part of Ritchie\\'s ArchipelagoIt\\'s known for its dive sites and beaches with its coral reefs."},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Lakshmanpur.jpg","description":"It is famous beaches of Neil Island,It is ideal for places for swimming and sun bathing."},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Little_Andaman.jpg","description":"Little Andaman Island is the fourth largest of the Andaman Islands of India with an area of 707 km."},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Mahatma_Gandhi_Marine_National_Park.jpg","description":"Is a national park of India near Wandoor on the Andaman Islands.."},{"dest_id":"1","image_url":"https:\/\/itourscloud.com\/destination_gallery\/asia\/india\/andaman_and_nicobar_islands\/Asia_India_Andaman_and_Nicobar_Islands_Neil_Island.jpg","descrip